import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Home from './components/Home';
import Navbar from './components/Navbar/Navbar';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        {/* Definir la ruta principal */}
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
  );
}

export default App;
